import Cells from '../src/images/girlcross.jpg'
class UnderNav extends Component {

    render() { 
        return ( 
            <div>
                <img src={Cells} alt="" className="responsive-img cells">

                </img>

            </div>
         );
    }
}

export default UnderNav;
